import React from "react";
import Navigation from "./navigation/Navigation";
import {
    Link
  } from "react-router-dom";
function DashBoard(){
    return(
    <>
    <Navigation/>
    <div className="mainBtn">
            <nav>
                <ul>
                    <li><Link to="searchbar">Search Images</Link></li>
                    <li>Search Users</li>
                </ul>
            </nav>
        </div>
    </>

    )
}

export default DashBoard
